import React, { Component, Fragment} from 'react';

import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

class addressBar extends Component {
  render() {
    var imageStyle = {
      width: "50%",
      marginLeft:"auto",
      marginRight: "auto"
    }

    return (
      <Paper elevation={3} style={{position: 'fixed', bottom:"10%", left:"10%", width:"80%", background:"WhiteSmoke"}}>
          <img src="/no_stores.svg" alt="Hombre caminando solo en callejón oscuro" style={imageStyle}></img>
          <h4>Opps! lo sentimos<br></br><small>No hay negocios registrados cerca de tí</small></h4>
          <p>Puedes cambiar de úbicación o si conoces negocios cerca de tu ubicación compartenos los datos y realizaremos el pedido por tí.</p>
          <Button variant="contained" color="primary">Primary</Button>
      </Paper>
    );
  }
}

export default addressBar;
